(110, '2020-02-10 09:00:00', '2020-02-10 12:00:00', 190, 200, 20, 96, 1, '<p class=\"MsoNormal\" style=\"margin-left:.25in;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><font face=\"Simplified Arabic, serif\"><span style=\"font-size: 12pt;\">Dears</span></font></p><p class=\"MsoNormal\" align=\"right\" style=\"margin-left:.25in;text-align:right;\r\nline-height:normal\"><u><span style=\"font-size:16.0pt;font-family:&quot;Simplified Arabic&quot;,&quot;serif&quot;\">Subject:Universities Fair 2020<o:p></o:p></span></u></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.25in\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Simplified Arabic&quot;,&quot;serif&quot;\">Al Manhal International Private School is looking to organize a “Universities Fair” on 30<sup>th</sup> of January,\r\n2020 from 10:00 AM to 1:00 PM in the school hall. We invite you all to join us on this date. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.25in\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Simplified Arabic&quot;,&quot;serif&quot;\">The aim of this gathering is to let our students\r\nand their parents meet you in one place, to\r\nanswer all our their questions about admission, course content, study\r\noptions, graduate careers and more. Total number of Al Manhal students in Grade\r\n12 + 11 is <b>390</b>, and we will invite their parents as well.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><font face=\"Simplified Arabic, serif\"><span style=\"font-size: 16px;\">Please send us ADEK approval on sahar@almanhalschool.ae</span></font></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 16px; font-family: &quot;Simplified Arabic&quot;, serif;\">For more information plea