(113, '2020-02-02 10:00:00', '2020-02-02 13:00:00', 110, 120, 20, 67, 1, '<p>Al Andalus Private School would like to welcome you to its Annual University Fair which is happening on:</p><p><b>Monday 3rd of February , 2020&nbsp;</b></p><p><b>9:00 AM to 12:00 PM</b></p><p>Each University can bring their one Roll up banner and Marketing Material, and will get one table and two chairs.</p><p>Please be at our school by maximum 8:45 AM to allow a setup time, as students are coming in sharp at 9:00 AM.</p><p>Wish you all a successful recruitment day with our school.</p><p>Best Regards,</p><p>Mrs. Atyat Al Rawashdeh</p><p>Al Andalus Private Academy&nbsp;</p>', NULL, '2019-12-10 04:49:59', '2020-01-30 09:33:29'),
(114, '2020-03-01 09:00:00', '2020-03-01 12:00:00', 150, 150, 20, 17, 1, '<p>Dear University Representative,</p><p><span style=\"font-size: 0.875rem;\">Al Resala International School of Science is pleased to invite you to its second annual university fair on the </span></p><p><span style=\"font-size: 0.875rem;\"><b>27 of Feb, 2020&nbsp; -&nbsp; 9:00 AM - 12:00 PM</b></span></p><p><span style=\"font-size: 16px;\"><span style=\"font-family: &quot;Times New Roman&quot;, serif;\">Students, from grades 11 and 12 will be attending the fair.&nbsp; We would be grateful if you could participate in our event and help our students pursue their future careers.</span></span><span style=\"font-family: &quot;Times New Roman&quot;, serif;\"></span><br><br><span style=\"font-size: 16px;\"><span style=\"font-family: Times New Roman, serif;\">Your organization will have a table and two chairs in Al Resalah International School of Science premises with your name and logo. You can distribute banners, brochures, invitation cards and posters to students so that they can have a better idea about your organization.</span></span></p><p>Looking forward to having you at our school.</p><p>Please confirm your registration through Udros.com platform.</p><p><span style=\"font-family: &quot;Times New Roman&quot;, serif;\"></span>Lama&nbsp;</p><p><span style=\"font-size: 0.875rem;\"><b style=\"\"><br></b></span><br></p>', NULL, '2019-12-12 05:20:24', '2020-01-02 02:34:42'),
