(118, '2020-02-04 11:00:00', '2020-02-04 13:00:00', 50, 55, 20, 110, 1, '<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\">Greetings from Al Sanawber Private School in Al Ain,</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\"><br></span><span style=\"text-indent: 36pt; font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\">We would like to invite you to Al Sanawber</span><span style=\"text-indent: 36pt; font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\">&nbsp;Private School annual University Fair, which is happening on&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><span style=\"text-indent: 36pt; font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\"><br></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><span style=\"text-indent: 36pt; font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\"><b>4 - Feb - 2020</b></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><span style=\"text-indent: 36pt; font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\"><b>12:00 - 2:00 PM</b></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\">Students, from grades 11 and 12 will be attending the fair.&nbsp; We would be grateful if you could participate in our event and help our students pursue their future careers.&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Each university will have a table and two chairs , and can bring along their marketing material.</span></font></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\"><br></span></font></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; caret-color: rgb(0, 0, 0); text-size-adjust: auto; text-align: justify; text-indent: 36pt;\"><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Please confirm your booking as soon as possible using Udros.com platform</span></font></p><p class=\"MsoNormal\"