(148, '2020-03-17 15:30:00', '2020-03-17 17:30:00', 45, 50, 40, 356, 1, '<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Dear universities/ High\r\nlearning affiliates<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Al Basma British School cordially\r\ninvites you to our annual university fair. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Our event will be held on <b><u>Tuesday 17th March 2020. </u></b>&nbsp;From 3:30pm – 5:30pm. We ask that you arrive\r\nat 3:00 pm to set up, where you will be given some light refreshments on\r\narrival, 2 tables and 2 chairs. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">The theme of the event is\r\ninnovation and we hope that speakers will be ready to talk about something\r\ninnovative that the university is currently working on, Including the usual\r\nrequirements.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;To give our students a chance to really\r\nflourish we hope to make connections that will allow them to attend special\r\nevents and workshops throughout the year. These types of connections will allow\r\nthe school’s students to have a clearer picture of their chosen university in\r\nthe coming months/year.&nbsp;</span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><b><u><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Please confirm</span></u></b><u><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> your <b>attendance\r\n</b>as early as possible, at the latest by<b> THURSDAY 20</b>&nbsp;<b><sup>th</sup> February 2020 <o:p></o:p></b></span></u></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Please email Mr Simon if you have any questions&nbsp;<a href=\"mailto:simon.g@albasmaschool.ae\">simon.g@albasmaschool.ae</a>&nbsp; &nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Kind Regards <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Mr Simon <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Event Organiser<o:p></o:p></span></p>', NULL, '2020-02-05 08:26:55', '2020-02-16 07:18:42'),
(149, '2020-02-20 09:30:00', '2020-02-20 15:00:00', 26, 27, 25, 103, 1, NULL, NULL, '2020-02-10 07:53:39', '2020-02-16 05:19:26'),
(151, '2020-10-08 11:00:00', '2020-10-08 01:00:00', 50, 50, 20, 359, 1, '<p>Sorry ... We will postpone our uni fair and that for some unexpected factors.&nbsp;</p><p>We would like to hold a university fair in our school. our students are 90% Emirati students.</p><p>Would you please prepare the ADEK approval and send it to my email ahlem@inpsaa.com&nbsp;</p><p>please feel free to contact me for any other inquiries.&nbsp;</p><p><br></p><p>Thank you</p><p><br></p>', '<p>Would you please let us know ASAP.</p><p>Thank you</p>', '2020-02-12 06:19:35', '2020-06-23 07:23:02'),
(153, '2020-03-17 09:00:00', '2020-03-17 11:00:00', 15, 54, 11, 1, 0, '<p>THIS IS A TEST EMAIL , PLEASE IGNORE IT</p><p>SORRY FOR THE INCONVENIENCE&nbsp;</p>', NULL, '2020-03-02 15:37:19', '2020-03-02 15:37:19'),
(154, '2020-05-28 12:00:00', '2020-05-28 14:00:00', 20, 30, 40, 263, 1, '<p>We are pleased to you invite to our first virtual fair at Dar Al Maarifa School which is happening on 21 of May from 12:00 to 2:00 PM.</p><p>Please confirm your registration the normal way, one credit will deducted from your remaining credit.</p><p>Also, feel free to advertise the event on your social media and invite any potential students to join as the event will open open to public as well.</p><p>We will share the event link with all of you shortly.</p><p><br></p><p><br></p>', NULL, '2020-05-14 09:22:49', '2020-05-19 06:17:47'),
